import time
from typing import List


# Solution 1: works but too slow
class Solution:
    def jobScheduling(self, startTime: List[int], endTime: List[int], profit: List[int]) -> int:
        n = len(startTime)
        jobs = [(startTime[i], endTime[i], profit[i]) for i in range(n)]
        jobs.sort()
        dp = [(0, 0, 0)]  # startTime, endTime, profit
        maxProfit = 0
        for i in range(n):
            startTime, endTime, profit = jobs[i]
            aux = dp[0]
            for e in dp[1:]:
                if e[1] <= startTime and e[2] > aux[2]:
                    aux = e

            dp.append((aux[0], endTime, aux[2]+profit))
            maxProfit = max(maxProfit, dp[-1][2])

        return maxProfit


# Solution 2
class Solution:
    def jobScheduling(self, startTime: List[int], endTime: List[int], profit: List[int]) -> int:
        n = len(startTime)
        jobs = [(startTime[i], endTime[i], profit[i]) for i in range(n)]
        jobs.sort(reverse=True)
        maxProfit = 0
        dp = [jobs[0]]
        for i in range(1, n):
            startTime, endTime, profit = jobs[i]
            aux = (startTime, endTime, profit)
            bottom, top = 0, i-1
            while bottom <= top:
                mid = (top+bottom)//2
                if dp[mid][0] >= endTime:
                    bottom = mid + 1
                    aux = (startTime, dp[mid][1], dp[mid][2]+profit)
                else:
                    top = mid - 1
            if aux[2] < dp[-1][2]:
                aux = dp[-1]
            dp.append(aux)
            maxProfit = max(maxProfit, aux[2])

        return maxProfit


